    'Maximum height managed by this carrier. Set the value to "0," or leave this field blank to ignore.' => 'Maksimaalne paki kõrgus, mis antud kuller vastu võtab. Määrake 0 või jätke antud väli tühjaks, kui soovite seda välja ignoreerida.',
