  'AdminShopparametersHelp' => 
  array (
    'Enable this option only if your server allows URL rewriting (recommended).' => 'Enable this option only if your server allows URL rewriting (recommended).',
    'URL rewriting (mod_rewrite) is not active on your server, or it is not possible to check your server configuration. If you want to use Friendly URLs, you must activate this mod.' => 'URL ülekirjutamine (mod_rewrite) ei ole aktiivne Teie serveris või ei suuda süsteem seda hetkel tuvastada. Kui soovite kasutada kliendisõbralike aadresse, siis peate selle aktiveerima.',
    'Enable this option if you want to allow accented characters in your friendly URLs.' => 'Enable this option if you want to allow accented characters in your friendly URLs.',
    'You should only activate this option if you are using non-latin characters ; for all the latin charsets, your SEO will be better without this option.' => 'Lülitage see ainult siis sisse, kui kasutate täpitähti ja vajate seda. Muidu toimib SEO paremini ilma selle valikuta.',
    'Enable this option only if you have problems with URL rewriting.' => 'Lülitage see valik sisse ainult siis, kui Teil on probleeme mõndade lehtede URL ümberkirjutamisega.',
    'Some of PrestaShop\'s features might not work correctly with a specific configuration of Apache\'s mod_security module. We recommend to turn it off.' => 'Some of PrestaShop\'s features might not work correctly with a specific configuration of Apache\'s mod_security module. We recommend to turn it off.',
    'You can search for a new domain name or add a domain name that you already own. You will be redirected to your PrestaShop account.' => 'Sa võid otsida uue domeeninime või lisada domeeninime mis sul juba on. Sind suunatakse sinu PrestShop\'i kontole.',
    'Name of the related page.' => 'Name of the related page.',
    'Title of this page.' => 'Title of this page.',
    'A short description of your shop.' => 'A short description of your shop.',
    'List of keywords for search engines.' => 'List of keywords for search engines.',
    'To add tags, click in the field, write something, and then press the "Enter" key.' => 'To add tags, click in the field, write something, and then press the "Enter" key.',
    'For instance, "contacts" for http://example.com/shop/contacts to redirect to http://example.com/shop/contact-form.php' => 'For instance, "contacts" for http://example.com/shop/contacts to redirect to http://example.com/shop/contact-form.php',
    'Only letters and hyphens are allowed.' => 'Only letters and hyphens are allowed.',
    'Invalid characters:' => 'Sobimatud tähemärgid:',
    'Image width in pixels. Enter "0" to use the original size.' => 'Pildi laius pikslites. Sisestage 0, et kasutada originaal suurust',
    'Image height in pixels. Enter "0" to use the original size.' => 'Pildi kõrgus pikslites. Sisestage 0, et kasutada originaal suurust',
    'Contact name (e.g. Customer Support).' => 'Kontakti nimi (nt. Klienditugi).',
    'Emails will be sent to this address.' => 'E-mailid saadetakse antud aadressile.',
    'If enabled, all messages will be saved in the "Customer Service" page under the "Customer" menu.' => 'Kui lubatud, siis kõik sõnumid salvestatakse "Klienditugi" kaardi alla Klientide all.',
    'Further information regarding this contact.' => 'Edaspidine informatsioon antud kontakti kohta.',
    'This field does not refer to the shop name visible in the front office.' => 'See väli ei viita nimele mis on veebipoes nähtav.',
    'Follow [1]this link[/1] to edit the shop name used on the front office.' => 'Kasuta [1]this link[/1], et muuta poe nime mida veebipood kasutab.',
    'You can\'t edit the shop group because the current shop belongs to a group with the "share" option enabled.' => 'Te ei saa poodide gruppi muuta, kuna praegune pood kuulub gruppi, kus on aktiveeritud andmete jagamise valikud.',
    'This is the root category of the store that you\'ve created. To define a new root category for your store, [1]please click here[/1].' => 'See on peakategooria Teie loodavele pole. Uue peakategooria määramiseks [1]kliki palun siia[/1].',
    'By selecting associated categories, you are choosing to share the categories between shops. Once associated between shops, any alteration of this category will impact every shop.' => 'Valides seotud kategooriaid, valite erinevate kategooriate jagamise poodide vahel. Korra poega liidetud kategooriate puhul, iga muudatus, mis kategoorias tehakse, mõjutab igat poodi, mis selle kategooriaga seotud on.',
    'Enable the automatic indexing of products. If you enable this feature, the products will be indexed in the search automatically when they are saved. If the feature is disabled, you will have to index products manually by using the links provided in the field set.' => 'Enable the automatic indexing of products. If you enable this feature, the products will be indexed in the search automatically when they are saved. If the feature is disabled, you will have to index products manually by using the links provided in the field set.',
    'By default, to search for “blouse”, you have to enter “blous”, “blo”, etc (beginning of the word) – but not “lous” (within the word).' => 'Vaikimisi - otsides "blouse" peate sisestama "blous", "blo" või muu kombinatsiooni (sõna algusest) - kuid mitte "lous" - (sõna keskelt).',
    'With this option enabled, it also gives the good result if you search for “lous”, “ouse”, or anything contained in the word.' => 'Selle võimalusega saad tulemuse ka siis kui sisestad \\"lous\\", \\"ouse\\" või mingi muu kombinatsiooni sõna seest.',
    'Enable search within a whole word, rather than from its beginning only.' => 'Pigem luba otsing sõna seest kui ainult algusest.',
    'It checks if the searched term is contained in the indexed word. This may be resource-consuming.' => 'See kontrollib kas otsitud termin on indekseeritud sõnade hulgas. See võib olla ressursinõudlik.',
    'By default, if you search "book", you will have "book", "bookcase" and "bookend".' => 'Vaikimisi, kui otsite "book", siis kuvatakse Teile "book", "bookcase" ja "bookend".',
    'With this option enabled, it only gives one result “book”, as exact end of the indexed word is matching.' => 'Selle võimalusega saad tulemuseks ainult \\"book\\"',
    'Enable more precise search with the end of the word.' => 'Luba palju täpsem otsing mis lõppeb otsitava terminiga',
    'It checks if the searched term is the exact end of the indexed word.' => 'See kontrollib kas otsitav termin sobib täpselt indekseeritud sõnaga',
    'Only words this size or larger will be indexed.' => 'Sellest pikemad sõnad indekseeritakse.',
    'Please enter the index words separated by a "|".' => 'Sisesta sõnad, mis on eraldatud püstkriipsuga ("|"-märgiga)',
    'Enter each alias separated by a comma (e.g. \'prestshop,preztashop,prestasohp\').' => 'Enter each alias separated by a comma (e.g. \'prestshop,preztashop,prestasohp\').',
    'Forbidden characters: <>;=#{}' => 'Keelatud tähemärgid: <>;=#{}',
    'Search this word instead.' => 'Otsi seda sõna hoopis.',
    'The group defined for your un-identified visitors.' => 'The group defined for your un-identified visitors.',
    'The group defined for your identified guest customers (used in guest checkout).' => 'The group defined for your identified guest customers (used in guest checkout).',
    'The group defined for your identified registered customers.' => 'The group defined for your identified registered customers.',
    'Automatically apply this value as a discount on all products for members of this customer group.' => 'Võimaldab automaatselt kõigile poe toodetele antud allahindluse selle grupi liikmetele.',
    'How prices are displayed in the order summary for this customer group.' => 'Kuidas näidatakse selle kliendigrupi tellimuste kokkuvõtet (maksudega või ilma)?',
    'Customers in this group can view prices.' => 'Customers in this group can view prices.',
    '%group_name% - All persons without a customer account or customers that are not logged in.' => '%group_name% - kõik kasutajad, kellel pole kliendi kontot või pole sisse loginud.',
    '%group_name% - All persons who placed an order through Guest Checkout.' => '%group_name% - kõik kasutajad, kes on esitanud tellimuse külalisena.',
    '%group_name% - All persons who created an account on this site.' => '%group_name% - kõik kliendid, kes on loonud konto antud poes.',
    'PrestaShop has three default customer groups:' => 'PrestaShopil on vaikimisi kolm kliendigruppi:',
    'Leave blank if no change.' => 'Leave blank if no change.',
    'Fee given for each visit.' => 'Tasu iga külastuse kohta',
    'Fee given for each order placed.' => 'Tasu iga ostu eest.',
    'If you know how to use MySQL regular expressions, you can use the [1]expert mode[/1].' => 'Kui oskate kasutada MySQL-i regulaaravaldisi, saate kasutada [1]eksperdirežiimi[/1].',
    'If you own an SSL certificate for your shop\'s domain name, you can activate SSL encryption (https://) for customer account identification and order processing.' => 'Kui Sul on SSL sertifikaat oma poe domeenile siis saad aktiveerida SSL krüpteerimise (https://) klientide tuvastamiseks ja ostmiseks.',
    'If you want to enable SSL on all the pages of your shop, activate the "Enable on all the pages" option below.' => 'Kui soovid lubada SSL\'i oma poe kõikidele lehtedele siis aktiveeri allpool \\"Luba kõikidel lehtedel\\"',
    'When enabled, all the pages of your shop will be SSL-secured.' => 'Kui lubada siis on poe kõik lehed SSL\'i krüpteeringuga.',
    'Enable or disable token in the Front Office to improve PrestaShop\'s security.' => 'Lülita sisse või välja turvamärk poes, et suurendada PrestaShopi turvalisust',
    'Allow iframes on text fields like product description. We recommend that you leave this option disabled.' => 'Allow iframes on text fields like product description. We recommend that you leave this option disabled.',
    'Clean the HTML content on text fields. We recommend that you leave this option enabled.' => 'Clean the HTML content on text fields. We recommend that you leave this option enabled.',
    'You can choose among 6 different ways of rounding prices. "Round up away from zero ..." is the recommended behavior.' => 'Saad valida ümardamiseks 6 võimalust. \\"Nullist eemale ... \\" ümardamine on enamlevinud ja soovituslik.',
    'You can choose when to round prices: either on each item, each line or the total (of an invoice, for example).' => 'Saad valida kuskohas ümardada : kas igal toote puhul, iga rea puhul või arve lõppsumma puhul.',
    'Choose how many decimals you want to display' => 'Vali mitu komakohta näidatakse',
    'Enable brands and suppliers pages on your front office even when their respective modules are disabled.' => 'Luba brändide ja tarnijate lehed esilehel ka siis, kui vastavad moodulid on keelatud.',
    'Enable best sellers page on your front office even when its respective module is disabled.' => 'Luba poes enimmüüdute näitamine, isegi kui vastav moodul on keelatud.',
    'The multistore feature allows you to manage several e-shops with one Back Office. If this feature is enabled, a "Multistore" page will be available in the "Advanced Parameters" menu.' => 'Mitmikpoe valik võimaldab Teil hallata mitut erinevat poodi ühest administraatori liidesest. Kui see on aktiveeritud, siis on nähtav Mitmikpoe menüü.',
    'Display an overview of the addresses, shipping method and cart just before the order button (required in some European countries).' => 'Kuvab ülevaate aadressidest, tarneviisist ja ostukorvi sisust enne tellimise kinnitamist (nõutud teatud Euroopa riikides).',
    'Allow guest visitors to place an order without registering.' => 'Luba külalistel oste vormistada ilma registreerimata.',
    'Disable the option to allow customers to reorder in one click from the order history page (required in some European countries).' => 'Lülitab välja võimaluse klientidel lihtsalt oma tellimuse ajaloo lehel uuesti samu tooteid tellida (nõutud mõnedes riikides).',
    'Set to 0 to disable this feature.' => 'Set to 0 to disable this feature.',
    'Automatically updates the shipping costs when you edit an order.' => 'Värskendab tellimuse muutmisel saatmiskulusid automaatselt.',
    'Allow the customer to ship orders to multiple addresses. This option will convert the customer\'s cart into one or more orders.' => 'Lubage klientidel saata oma tellimust mitmele erinevale aadressile',
    'Allows you to delay shipping at your customers\' request.' => 'Lubab kliendi soovil tarnega viivitada.',
    'Require customers to accept or decline terms of service before processing an order.' => 'Nõua klientidelt ostutingimustega nõustumist, enne ostu vormistamist',
    'Choose the page which contains your store\'s terms and conditions of use.' => 'Valige leht, mis sisaldab poe kasutustingimusi.',
    'Suggest gift-wrapping to customers.' => 'Paku klientidele kinkepakendi võimalust, koos täiendava sõnumi lisamisega pakendile',
    'Set a price for gift wrapping.' => 'Set a price for gift wrapping.',
    'Set a tax for gift wrapping.' => 'Set a tax for gift wrapping.',
    'Suggest recycled packaging to customer.' => 'Suggest recycled packaging to customer.',
    'Order status (e.g. \'Pending\').' => 'Order status (e.g. \'Pending\').',
    'Invalid characters: numbers and' => 'Keelatud tähemärgid: numbrid ja ',
    'Upload an icon from your computer (File type: .gif, suggested size: 16x16).' => 'Lae üles ikoon oma arvutist (failitüüp: .gif, soovitatav suurus 16x16 px).',
    'Status will be highlighted in this color. HTML colors only.' => 'Status will be highlighted in this color. HTML colors only.',
    'Only letters, numbers and underscores ("_") are allowed.' => 'Only letters, numbers and underscores ("_") are allowed.',
    'Email template for both .html and .txt.' => 'Email template for both .html and .txt.',
    'Order\'s return status name.' => 'Tellimuse tagastuse staatuse nimi.',
    'Whether or not to display this store.' => 'Whether or not to display this store.',
    'Storefront picture.' => 'Storefront picture.',
    'Displayed in emails sent to customers.' => 'Displayed in emails sent to customers.',
    'Shop registration information (e.g. SIRET or RCS).' => 'Shop registration information (e.g. SIRET or RCS).',
    'characters' => 'tähemärki',
    'By default, the Add to Cart button is hidden when a product is unavailable. You can choose to have it displayed in all cases.' => 'Vaikimisi on Lisa ostukorvi nupp peidetud, kui toode pole saadaval. Võite määrata, et näitate seda igal juhul.',
    'When selling packs of products, how do you want your stock to be calculated?' => 'Kui müüte toodete pakke, kuidas soovite laoseisu arvutada?',
    'Number of products displayed per page. Default is 10.' => 'Tooteid lehel. Vaikimisi on 10.',
    'The order in which products are displayed in the product list.' => 'Vaikimisi sorteerimine toote nimekirjas',
    'Default order method for product list.' => 'Default order method for product list.',
    'After a customer logs in, you can recall and display the content of his/her last shopping cart.' => 'Peale kliendi sisse logimist, kuvatakse talle tema eelmise ostukorvi sisu.',
    'Send an email with summary of the account information (email, password) after registration.' => 'Send an email with summary of the account information (email, password) after registration.',
    'Minimum time required between two requests for a password reset.' => 'Minimaalne aeg kahe uue salasõna tellimuse vahel.',
    'Activate or deactivate B2B mode. When this option is enabled, B2B features will be made available.' => 'Lubage või keelake B2B moodus. Kui see valik on valitud, siis on saadaval mõned B2B lahendused.',
    'Display or not the partner offers tick box, to receive offers from the store\'s partners.' => 'Kas kuvada partneri pakkumiste märkeruutu, et saada pakkumisi poe partneritelt.',
    'Set the maximum size of the summary of your product description (in characters).' => 'Seadke oma tootekirjelduse max pikkus (tähemärkides).',
    'How to calculate quantity discounts.' => 'How to calculate quantity discounts.',
    'When active, friendly URL will be updated on every save.' => 'When active, friendly URL will be updated on every save.',
    'When active, new products will be activated by default during creation.' => 'Kui aktiivne, aktiveeritakse uued tooted loomisel vaikimisi.',
    'Set to "0" to disable this feature.' => 'Pange 0, kui te ei soovi antud valikut kasutada',
    'Display or hide the "add to cart" button on category pages for products that have attributes forcing customers to see product details.' => 'Näidake või keelake "Lisa ostukorvi" nupp kategooria lehtedele toodetele, millel on kohandusvõimalused. Siis peavad kliendid kogu toote lehte vaatama.',
    'In the volume discounts board, display the new price with the applied discount instead of showing the discount (ie. "-5%").' => 'Koguselise allahindluse tabelis, näidake uut hinda, millest on soodustus juba maha võetud. Vaikimisi näidatakse lihtsalt soodustust (nt. -5%).',
    'Activate or deactivate your shop (It is a good idea to deactivate your shop while you perform maintenance. Please note that the webservice will not be disabled).' => 'Lubage või keelake pood. On hea lülitada pood välja hooldustööde ajaks.',
    'IP addresses allowed to access the front office even if the shop is disabled. Please use a comma to separate them (e.g. 42.24.4.2,127.0.0.1,99.98.97.96)' => 'Hooldustööde ajaks poodi lubatud IP addressid. Kasuta eraldamiseks koma.(nt. 42.24.4.2, 127.0.0.1, 99.98.97.96)',
    'Custom text displayed on maintenance page while shop is deactivated.' => 'Kohandatud tekst, mida kuvatakse hoolduslehel, kui pood on inaktiveeritud.',
    'e.g. 10:00AM - 9:30PM' => 'Näiteks: 10:00-21:30',
    'There is a huge quantity of data, so each connection corresponding to a referrer is indexed. You can also refresh this index by clicking the "Refresh index" button. This process may take a while, and it\'s only needed if you modified or added a referrer, or if you want changes to be retroactive.' => 'There is a huge quantity of data, so each connection corresponding to a referrer is indexed. You can also refresh this index by clicking the "Refresh index" button. This process may take a while, and it\'s only needed if you modified or added a referrer, or if you want changes to be retroactive.',
    'Your data is cached in order to sort it and filter it. You can refresh the cache by clicking on the "Refresh cache" button.' => 'Your data is cached in order to sort it and filter it. You can refresh the cache by clicking on the "Refresh cache" button.',
    'Direct traffic can be quite resource-intensive. You should consider enabling it only if you have a strong need for it.' => 'Otsekülastuste maht võib olla üsna mahukas. Peaksite selle sisse lülitama ainult siis, kui Teil on tugev andmebaasi server ja tungiv vajadus selle järgi.',
    'Show me more' => 'Näita rohkem',
    'Definitions:' => 'Definitsioonid:',
    'The "http_referer" field is the website from which your customers arrive.' => 'The "http_referer" field is the website from which your customers arrive.',
    'For example, visitors coming from Google will have an "http_referer" value like this one: "http://www.google.com/search?q=prestashop".' => 'For example, visitors coming from Google will have an "http_referer" value like this one: "http://www.google.com/search?q=prestashop".',
    'If the visitor arrives directly (by typing the URL of your shop, or by using their bookmarks, for example), the http_referer will be empty.' => 'If the visitor arrives directly (by typing the URL of your shop, or by using their bookmarks, for example), the http_referer will be empty.',
    'If you\'d like to view all the visitors coming from Google, you can type "%google%" in this field. Alternatively, you can type "%google.fr%" if you want to view visitors coming from Google France, only.' => 'Nii et kui soovite, et kõik külastajad tulevad google, võite tippida \\"% google%\\". Kui soovite hankida infot Google Prantsusmaa kaudu tulevate klientide andmeid, siis sisestage \\"% google.fr%\\".',
    'The "request_uri" field is the URL from which the customers come to your website.' => 'The "request_uri" field is the URL from which the customers come to your website.',
    'For example, if the visitor accesses a product page, the URL will be like this one: "%smusic-ipods/1-ipod-nano.html".' => 'For example, if the visitor accesses a product page, the URL will be like this one: "%smusic-ipods/1-ipod-nano.html".',
    'This is helpful because you can add tags or tokens in the links pointing to your website.' => 'See on kasulik, sest saate lisada mõningaid märke ja silte linkidele, mis Teie poodi toovad.',
    'For example, you can post a link (such as "%sindex.php?myuniquekeyword" -- note that you added "?myuniquekeyword" at the end of the URL) in an online forum or as a blog comment, and get visitors statistics for that unique link by entering "%%myuniquekeyword" in the "request_uri" field.' => 'For example, you can post a link (such as "%sindex.php?myuniquekeyword" -- note that you added "?myuniquekeyword" at the end of the URL) in an online forum or as a blog comment, and get visitors statistics for that unique link by entering "%%myuniquekeyword" in the "request_uri" field.',
    'This method is more reliable than the "http_referer" one, but there is one disadvantage: if a search engine references a page with your link, then it will be displayed in the search results and you will not only indicate visitors from the places where you posted the link, but also those from the search engines that picked up that link.' => 'This method is more reliable than the "http_referer" one, but there is one disadvantage: if a search engine references a page with your link, then it will be displayed in the search results and you will not only indicate visitors from the places where you posted the link, but also those from the search engines that picked up that link.',
    'The "Include" fields indicate what has to be included in the URL.' => 'The "Include" fields indicate what has to be included in the URL.',
    'The "Exclude" fields indicate what has to be excluded from the URL.' => 'The "Exclude" fields indicate what has to be excluded from the URL.',
    'When using simple mode, you can use a wide variety of generic characters to replace other characters:' => 'Lihtsa režiimi kasutamisel saate asendada muid tähemärke suure valiku üldiste sümbolitega:',
    '"_" will replace one character. If you want to use the real "_", you should type this: "\\\\_".' => '"_" will replace one character. If you want to use the real "_", you should type this: "\\\\_".',
    '"%" will replace any number of characters. If you want to use the real "%", you should type this: "\\\\%".' => '"%" will replace any number of characters. If you want to use the real "%", you should type this: "\\\\%".',
    'The Simple mode uses the MySQL "LIKE" pattern matching, but for a higher potency you can use MySQL\'s regular expressions in the Expert mode.' => 'The Simple mode uses the MySQL "LIKE" pattern matching, but for a higher potency you can use MySQL\'s regular expressions in the Expert mode.',
    'Take a look at MySQL\'s documentation for more details.' => 'Take a look at MySQL\'s documentation for more details.',
    'Get help!' => 'Abi!',
  ),
  'AdminShopparametersNotification' => 
  array (
    'Before you can use this tool, you need to:' => 'Enne selle tööriista kasutamist peate:',
    '1) Create a blank .htaccess file in your root directory.' => '1) Create a blank .htaccess file in your root directory.',
    '2) Give it write permissions (CHMOD 666 on Unix system).' => '2) Give it write permissions (CHMOD 666 on Unix system).',
    'Your robots.txt file MUST be in your website\'s root directory and nowhere else (e.g. http://www.example.com/robots.txt).' => 'Your robots.txt file MUST be in your website\'s root directory and nowhere else (e.g. http://www.example.com/robots.txt).',
    'Generate your "robots.txt" file by clicking on the following button (this will erase the old robots.txt file)' => 'Genereerige uus robots.txt fail vajutades järgnevale nupule (vana robots.txt fail kirjutatakse üle)',
