  'ModulesStatsregistrationsAdmin' => 
  array (
    'Customer accounts' => 'Kliendi kontod',
    'Adds a registration progress tab to the Stats dashboard.' => 'Lisab Statistikale registreerimise edenemise saki.',
    'Number of visitors who stopped at the registering step:' => 'Külastajad, kes on peatunud registreerumise sammul:',
