    'Number of customer accounts created' => 'Kokku loodud kliendikontosid',
    'The total number of accounts created is not in itself important information. However, it is beneficial to analyze the number created over time. This will indicate whether or not things are on the right track. You feel me?' => 'Loodud kliendikontode arv ei ole iseensest tähtis info. Samas on võimalik pikema aja vältel selle põhjal aru saada, kas poe külastajad liiguvad "õiges" suunas või mitte.',
