    'If you let your shop run without changing anything, the number of customer registrations should stay stable or show a slight decline.' => 'Kui Sa poes midagi ei muuda siis peaks registreerimiste arv olema stabiilne või aja jooksul natuke vähenema.',
    'A significant increase or decrease in customer registration shows that there has probably been a change to your shop. With that in mind, we suggest that you identify the cause, correct the issue and get back in the business of making money!' => 'Märkimisväärne tõus või langus näitab, et poes on midagi muutunud. Soovitame seda meeles pidada ja põhjuse välja uurida, et saaksid oma äri edukalt edasi ajada.',
    'Here is a summary of what may affect the creation of customer accounts:' => 'Siin on kokkuvõte asjadest mis võivad registreerimiste arvu suurendada :',
    'An advertising campaign can attract an increased number of visitors to your online store. This will likely be followed by an increase in customer accounts and profit margins, which will depend on customer "quality." Well-targeted advertising is typically more effective than large-scale advertising... and it\'s cheaper too!' => 'Reklaamikampaania on kindlasti üks põhjustest. Suunatud reklaam on palju mõjusam kui laiapõhjaline ja igale poole minev. Suunatud reklaam on ka odavam.',
    'Specials, sales, promotions and/or contests typically demand a shoppers\' attentions. Offering such things will not only keep your business lively, it will also increase traffic, build customer loyalty and genuinely change your current e-commerce philosophy.' => 'Eripakkumised, soodusmüügid, promo, võistlused jne on samuti kliendimeelitajad. Selliste asjade pakkumine mitte ainult ei hoia äri elus aga ka suurendab liiklust, tekitab klientides lojaalsust ja muudab ka Sinu poe filosoofiat.',
    'Design and user-friendliness are more important than ever in the world of online sales. An ill-chosen or hard-to-follow graphical theme can keep shoppers at bay. This means that you should aspire to find the right balance between beauty and functionality for your online store.' => 'Disain ja kasutajasõbralikkus on moodsas maailmas järjest tähtsam. Rõvedate piltide ja haige graafilise kujundusega suudab edukalt kõik kliendid minema ajada. Seega pead oma poes leidma kesktee ilu ja funktsionaalsuse vahel.',
